import React from 'react';
import { Link } from 'react-router-dom';

function Nav() {
  return (
    <div>
      <nav id="navbar">
        <ul>
          <li><Link to="/art">works</Link></li>
          <li><Link to="/design">design</Link></li>
          <li><Link to="/about-me">about me</Link></li>
        </ul>
      </nav>
    </div>
  )
}

function Header() {
  return (
    <div>
      <header>
        <h1>corey de'juan sherrard jr</h1>
        <h2>artist + engineer</h2>
        <div id="update">
          <h3>**NOW**</h3>
          <h4>
            Residency at <b>Sanman Studios (Houston, TX)</b> and <br/>
            <b>Wave Farm Radio Art Residency (Acra, NY)</b><br/>
            <b>**March to December 2025 at Sanman**</b>
          </h4>
        </div>
      </header>
      <Nav/>
    </div>
  )
}

